  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Necedah NWR outlines
  Refuge accomplishments from January through April of 1957. The report begins by
  summarizing the weather conditions, water conditions, and food and cover during
  this period. Wildlife- including migratory birds, upland game birds, furbearers,
  predators, rodents, mammals, and raptors- is also covered. The Refuge development
  and maintenance section discusses physical developments, plantings, and collections
  and receipts. Resource management is outlined; topics include timber removal. A
  progress report on field investigations and applied research is also provided. The
  public relations section of the report describes recreational uses, Refuge visitors,
  and fishing. N-R forms and photographs are attached.\",\n\t\"license_title\": \"License
